import './App.css';
import ProductForm from './components/ProductForm';
import {
  BrowserRouter,
  Link,
  Route,
  Switch
} from 'react-router-dom'
import OneProudct from './components/OneProudct';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
      <Link to="/">Home</Link>
      <Switch>
        <Route exact path="/">
          <ProductForm/>
        </Route>
        <Route exact path="/Products/:id">
          <OneProudct/>
        </Route>

          <ProductForm/>
      </Switch>

      </div>
    </BrowserRouter>
  );
}

export default App;
